import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () => {
    const menuItems = [
        { path: '/', icon: 'üè†', label: 'Dashboard' },
        { path: '/members', icon: 'üë•', label: 'Members' },
        { path: '/trainers', icon: 'üèãÔ∏è', label: 'Trainers' },
        { path: '/sessions', icon: 'üìÖ', label: 'Sessions' },
        { path: '/payments', icon: 'üí≥', label: 'Payments' },
        { path: '/equipment', icon: 'üèÉ', label: 'Equipment' },
        { path: '/attendance', icon: '‚úÖ', label: 'Attendance' },
        { path: '/feedback', icon: 'üí¨', label: 'Feedback' },
        { path: '/reports', icon: 'üìä', label: 'Reports' }
    ];

    return (
        <div className="sidebar">
            <div className="sidebar-header">
                <div className="sidebar-logo">üí™</div>
                <h2>Gym Manager</h2>
            </div>
            <nav className="sidebar-nav">
                <ul>
                    {menuItems.map((item) => (
                        <li key={item.path}>
                            <NavLink 
                                to={item.path} 
                                className={({ isActive }) => isActive ? 'active' : ''}
                                end={item.path === '/'}
                            >
                                <span className="nav-icon">{item.icon}</span>
                                <span className="nav-label">{item.label}</span>
                            </NavLink>
                        </li>
                    ))}
                </ul>
            </nav>
        </div>
    );
};

export default Sidebar;
